define({"topics" : [{"title":"JCE for Oracle JVM","href":"datacollector\/UserGuide\/Installation\/InstallationAndConfig.html#concept_jfj_qhq_tz","attributes": {"data-id":"concept_jfj_qhq_tz",},"menu": {"hasChildren":false,},"tocID":"concept_jfj_qhq_tz-d46e13704","topics":[]},{"title":"Configuring the Open File Limit","shortdesc":"\n                  <p class=\"shortdesc\"><span class=\"ph\">Data Collector</span>         requires a large number of file descriptors to work correctly with all stages. Most         operating systems provide\n                     a configuration to limit the number of files a process or a user         can open. The default values are usually less than\n                     the <span class=\"ph\">Data Collector</span>         requirement of <span class=\"ph\">32768</span> file descriptors. \n                  </p>\n               ","href":"datacollector\/UserGuide\/Installation\/InstallationAndConfig.html#concept_al3_qz5_jz","attributes": {"data-id":"concept_al3_qz5_jz",},"menu": {"hasChildren":false,},"tocID":"concept_al3_qz5_jz-d46e13726","topics":[]},{"title":"Default Ports","href":"datacollector\/UserGuide\/Installation\/InstallationAndConfig.html#concept_nv5_hbt_tdb","attributes": {"data-id":"concept_nv5_hbt_tdb",},"menu": {"hasChildren":false,},"tocID":"concept_nv5_hbt_tdb-d46e13769","topics":[]}]});